tableData:
{{ (() => {
  let data = q_getProductos.data || [];

  // Filtro por SelectFiltros (familia_id)
  const selectedValue = SelectFiltros && SelectFiltros.selectedOptionValue;
  if (selectedValue && String(selectedValue) !== 'todos') {
    data = data.filter(row => row.familia_id && String(row.familia_id) === String(selectedValue));
  }

  return data;
})() }}
